import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import  "./Navbar.css"

function Navbar() {
  const [linkStyle,setLinkStyle]=useState(true)
  
  const changecolor=(e)=>{
    const id=e.target.id;
    if(id){
    setLinkStyle( {
      textDecoration: "none",
      color:"grey",
      fontSize:25,
})}}
  const changecolorback=()=>{setLinkStyle( {
    textDecoration: "none",
    color:"white",
    fontSize:25,
})}
  return (
    <div className='Nav'>
      <img src='/IMAGES/logo.png' width="82px"/>
      <ul>
        <li><Link   to="/"
        li style={{
        textDecoration: "none",
        color:"white",
        fontSize:25,
  }} onMouseEnter={changecolor}  onMouseLeave={changecolorback} id={1}>Home</Link></li>
        <li><Link to=""  style={{
        textDecoration: "none",
        color:"white",
        fontSize:25,
  }} onMouseEnter={changecolor}  onMouseLeave={changecolorback} id={2}>Categories</Link></li>
        <li><Link to=""  style={{
        textDecoration: "none",
        color:"white",
        fontSize:25,
  }}  onMouseEnter={changecolor}  onMouseLeave={changecolorback} id={3}>About</Link></li>
        <li><Link to=""  style={{
        textDecoration: "none",
        color:"white",
        fontSize:25,
  }}  onMouseEnter={changecolor}  onMouseLeave={changecolorback} id={4}>Contact</Link></li>
        <li><Link to=""  style={{
        textDecoration: "none",
        color:"white",
        fontSize:25,
  }}  onMouseEnter={changecolor}  onMouseLeave={changecolorback} id={5}>Latest </Link></li>
      </ul>
        
    </div>
  )
}

export default Navbar
